import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 16.1-103 Proceedings by interrogatories.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-103.md","filePath":"vacode/16.1-103.md"}'),a={name:"vacode/16.1-103.md"},n=o('<h1 id="§-16-1-103-proceedings-by-interrogatories" tabindex="-1">§ 16.1-103 Proceedings by interrogatories. <a class="header-anchor" href="#§-16-1-103-proceedings-by-interrogatories" aria-label="Permalink to &quot;§ 16.1-103 Proceedings by interrogatories.&quot;">​</a></h1><p>Whenever a fieri facias has been issued upon a judgment rendered in a general district court the judge or clerk of the court may issue the summons provided for in § <a href="http://law.lis.virginia.gov/vacode/8.01-506/" target="_blank" rel="noreferrer">8.01-506</a>. In such case the judge of the general district court shall have all of the powers and authority respecting interrogatories conferred by §§ <a href="http://law.lis.virginia.gov/vacode/8.01-506/" target="_blank" rel="noreferrer">8.01-506</a> to <a href="http://law.lis.virginia.gov/vacode/8.01-510/" target="_blank" rel="noreferrer">8.01-510</a> upon any court or judge mentioned therein. The commissioner before whom any person is required to appear by such summons shall have the same powers and authority as if such summons had been issued under § <a href="http://law.lis.virginia.gov/vacode/8.01-506/" target="_blank" rel="noreferrer">8.01-506</a>. All interrogatories, answers, reports and other proceedings under such summons, and also all money, evidences of indebtedness and other security in the hands of an officer which are directed by any section of Chapter 18 (§ <a href="http://law.lis.virginia.gov/vacode/8.01-466/" target="_blank" rel="noreferrer">8.01-466</a> et seq.) of Title 8.01 to be returned or delivered to such court or judge, or to the clerk&#39;s office of such court, shall, when the summons was issued by a judge of a general district court be returned or delivered in like manner to the court from which the summons issued.</p><p>From any order of the judge of the general district court which involves the disposition of any money or property exceeding the sum of fifty dollars in value, exclusive of interest, there shall be an appeal in the same manner and upon the same conditions as in appeals from judgments rendered in civil matters in general district courts.</p><p>1956, c. 555; 1978, c. 66; 1983, c. 499.</p>',4),i=[n];function s(d,c,h,l,u,f){return r(),t("div",null,i)}const m=e(a,[["render",s]]);export{p as __pageData,m as default};
